import { Table, Tag } from 'antd';
const columns = [
    {
        title:'',
        dataIndex:'p',
        key:'p',
    },
    {
        
      title: 'Bam ID',
      dataIndex: 'BamID',
      key: 'BamID',
      width:'20%'
    },
    {
        
      title: 'Pit Level',
      dataIndex: 'PitLevel',
      key: 'PitLevel',
      width: '20%',
    },
    {
        
      title: 'Increase vs.prior week',
      dataIndex: 'Increasevspriorweek',
      key: 'Increasevspriorweek',
    },
  ];

  const data = [
    {
      key: 1,
      BamID: 'Bam 1',
      PitLevel: '42 in',
      Increasevspriorweek: '1.1 in',
    },
    {
      key: 2,
      BamID: 'Bam 2',
      PitLevel: '38 in',
      Increasevspriorweek: '0.9 in',
    },
    {
      key: 3,
      BamID: 'Bam 3',
      PitLevel: '55 in',
      Increasevspriorweek: '3.9 in',
    },
    {
      key: 4,
      BamID: 'Bam 4',
      PitLevel: '39 in',
      Increasevspriorweek: '1.4 in',
    },
  ];
  

class Exception extends React.Component{
    render(){
        return(
            <div className="tableException">
                <h1>Exception Reports</h1>
                <Table columns={columns} dataSource={data} />
            </div>
        );
    }
}

export default Exception;
